package com.yaowang.lansha.service.impl;import java.util.List;import java.util.Map;import javax.annotation.Resource;import org.springframework.stereotype.Service;import com.yaowang.common.dao.PageDto;import com.yaowang.lansha.dao.YwUserRoomLogDao;import com.yaowang.lansha.entity.YwUserRoomLog;import com.yaowang.lansha.service.YwUserRoomLogService;/** * 直播间人数日志  * @author  *  */@Service("ywUserRoomLogService")public class YwUserRoomLogServiceImpl implements YwUserRoomLogService{	@Resource	private YwUserRoomLogDao ywUserRoomLogDao;		@Override	public YwUserRoomLog save(YwUserRoomLog entity){		return ywUserRoomLogDao.save(entity);	}		@Override	public Integer delete(String[] ids){		return ywUserRoomLogDao.delete(ids);	}		@Override	public Integer update(YwUserRoomLog entity){		return ywUserRoomLogDao.update(entity);	}		@Override	public YwUserRoomLog getYwUserRoomLogById(String id){		return ywUserRoomLogDao.getYwUserRoomLogById(id);	}		@Override	public Map<String, YwUserRoomLog> getYwUserRoomLogMapByIds(String[] ids){		return ywUserRoomLogDao.getYwUserRoomLogMapByIds(ids);	}		@Override	public List<YwUserRoomLog> getYwUserRoomLogList(YwUserRoomLog entity){		return ywUserRoomLogDao.getYwUserRoomLogList(entity);	}		@Override	public List<YwUserRoomLog> getYwUserRoomLogPage(YwUserRoomLog entity, PageDto page){		return ywUserRoomLogDao.getYwUserRoomLogPage(entity, page);	}	@Override	public List<YwUserRoomLog> report(YwUserRoomLog entity) {		return ywUserRoomLogDao.report(entity);	}	}